import { Avatar } from '@mui/material';
import { Box } from '@mui/system';
import React, {UseState}from 'react';
import NavbarSeller from './navbarSeller';
const MyProfile = () => {
    return ( <>
     <NavbarSeller/>
     <Box sx={{
        positon:"absolute",
        top:"100px",
        width:"100%",
        height:"150px",
        backgroundColor:"gray"
     }}>
        <Avatar sx={{
            position:"absolute",
            left:"45%",
            width:"10%",
         
            height:"10%"
        }}></Avatar>
     </Box>

    </> 
    );
}

export default MyProfile;
